import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const Auto = () => {
    return (
      <div  className="flex-container flex-colomn pos-rel">
        <input id="auto" placeholder="type search"/>
      </div>
    )
  }
  return (
    <div className="App">
      <h1>Custom auto complete React</h1>
      <div className="logo"></div>
      <div className="auto-container"></div>
        <Auto/>
    </div>
  );
}

export default App;
